import logo from './logo.svg';
import './App.css';
import PropTypes from 'prop-types';
import Example from '../container/example'


const DopComponent = ({ helloText, count }) => {
    return (
        <div className="App">
            <header className="App-header">
                <img src={logo} className="App-logo" alt="logo" />
                <p>
                    {helloText}
                </p>
                <a
                    className="App-link"

                    target="_blank"
                    rel="noopener noreferrer"
                >
                    Learn React
        </a>
                <div className="but">
                </div>
                <div className="but1">
                    {count}
                </div>
            </header>
            <div>
                <Example />
            </div>
        </div>
    );
}


export default {DopComponent};
